import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./style.module.css";

function Nav() {
  return (
    <nav>
      <h3>Home</h3>
      <Link to="/about">
        <h3>About</h3>
      </Link>
    </nav>
  );
}

export default Nav;
